import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='row first'>
        <div className='col-2'>
          <p>Real Estate Search Website</p>
        </div>
        <div className='col-10'>
          <p>Suresh</p>
        </div>
      </div>
    </div>
  );
}

export default App;
